{
    "messages": [
      {
        "role": "user",
        "content": [
           {
              "type": "text",
              "text": "Describe this picture. Include comments on where these people probably work and which city this venue is in."
           },
           {
              "type": "image_url",
              "image_url": {
                 "url": "https://cloudwars.com/wp-content/uploads/2021/12/Jennifer-Morgan.jpeg"
              }
          }
        ]
      }
    ],
    "max_tokens": 500
}

{
"contents": [
    {"role": "user", "parts": { "text": "Write an essay describing SAP AI Core, a service within its product called Business Technology Platform (BTP)." }}],

"safety_settings": {"category": "HARM_CATEGORY_SEXUALLY_EXPLICIT", "threshold": "BLOCK_LOW_AND_ABOVE"},
 "generation_config": {
 "temperature": 0.9,
 "topP": 1,
 "candidateCount": 1,
 "maxOutputTokens": 2048
 }
}

{
    "orchestration_config": {
        "module_configurations": {
            "templating_module_config": {
                "template": [
                    {
                        "role": "system",
                        "content": "My email is aman.chopra@sap.com, my number is 510-386-2303, and my name is Aman Chopra. Draft an email to the CTO of SAP asking for a summary of SAP's AI Strategy. Include my email, name, and phone number as well in the closing.."
                    }
                ]
            },
            "llm_module_config": {
                "model_name": "gpt-4o-mini",
                "model_params": {
                    "max_tokens": 500,
                    "temperature": 0.1,
                    "frequency_penalty": 0,
                    "presence_penalty": 0
                }
            },
            "filtering_module_config": {
                "output": {
                    "filters": [
                        {
                            "type": "azure_content_safety",
                            "config": {
                                "Hate": 0,
                                "SelfHarm": 0,
                                "Sexual": 0,
                                "Violence": 0
                            }
                        }
                    ]
                }
            },
            "masking_module_config": {
                "masking_providers": [
                    {
                        "type": "sap_data_privacy_integration",
                        "method": "anonymization",
                        "entities": [
                            {
                                "type": "profile-email"
                            }
                        ]
                    }
                ]
            }
        }
    }
}
